import React from 'react';
import { Link } from 'react-router-dom';

const Cards = () => {
  return (
    <div className='cards'>
      <Link to='/browse'>
        <img
          src='https://images-eu.ssl-images-amazon.com/images/G/31/prime/PEX/PeX-Top-PC-1500X375.jpg'
          alt=''
        />
      </Link>
    </div>
  );
};

export default Cards;
